import { Link } from "react-router-dom";

function CityData(props) {


  return (
    <div>
      <input type="text" placeholder="type in a city" onChange={props.changeInput}></input>
      <Link to="/citydata/:city">
        <button onClick>Submit</button>
      </Link>
    </div>
  )

}

export default CityData
